--
-- Table structure for table `orders`
--

DROP TABLE IF EXISTS `orders`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `orders` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `cost` double NOT NULL,
  `payment_method` enum('COD','Paypal','VISA') NOT NULL,
  `shipment_fee` double NOT NULL,
  `other_fee` double DEFAULT NULL,
  `alter_phone_number` char(10) DEFAULT NULL,
  `alter_address` text,
  `alter_zip_postal` char(5) DEFAULT NULL,
  `inTotal` double NOT NULL,
  `paid` tinyint NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `orders_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`),
  CONSTRAINT `check_alter_postal_length` CHECK ((char_length(`alter_zip_postal`) <= 30)),
  CONSTRAINT `check_cost_positive` CHECK ((`cost` >= 0)),
  CONSTRAINT `check_other_fee_positive` CHECK ((`cost` >= 0)),
  CONSTRAINT `check_shipment_fee_positive` CHECK ((`cost` >= 0)),
  CONSTRAINT `check_total_length` CHECK ((`inTotal` >= 0))
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
